import React from "react";
import "./App.css";

import colors from "./utils/colors";
import Screen from "./components/Screen";

import Bojan from "./assets/Bojan.gif";
import Mila from "./assets/Mila.gif";
import Lutka from "./assets/Lutka.gif";
import Ceskam from "./assets/Ceskam.gif";
import Inaet from "./assets/Inaet.gif";
import Gresam from "./assets/Gresam.gif";
import ZaMene from "./assets/ZaMene.gif";
import ZaTebe from "./assets/ZaTebe.gif";
import Interesno from "./assets/Interesno.gif";
import BojanMila from "./assets/MilaBojan.gif";
import TeSakam from "./assets/TeSakam.gif";
import Valentine from "./assets/Valentine.gif";
//import Woooooooo from "./assets/.gif";



const App = () => {

  return (
    <div className="main">
      <Screen
        imageUrl={ursinho_pandinha_ok}
        bgColor={colors.red}
        textColor={colors.white}
        title="Bojan"
        text="Zdravo Mila, jas sum Bojan denes ke ti prezentiram edna ubava stranica specijano napravena za tebe."
        btnText="<3"
        sequency="1"
      />
      <Screen
        imageUrl={ursinho_estudando}
        bgColor={colors.blue}
        textColor={colors.white}
        title="Mila"
        text="Zapocnuvajki so tebe, ti si najubaovoto nesto sto mozelo da mi se sluci"
        btnText="<3"
        sequency="2"
      />
      <Screen
        imageUrl={pandinha}
        bgColor={colors.pink}
        textColor={colors.white}
        title="Lutka"
        text="Da moze cesto se lutis, i se nerviras"
        btnText="<3"
        sequency="3"
      />
      <Screen
        imageUrl={pandinha_martelo}
        bgColor={colors.blue}
        textColor={colors.white}
        title="Baras ceskanje"
        text="Da moze ponekogas nerviras so ceskanjeto (No sekako ke te ceskam)"
        btnText="<3"
        sequency="4"
      />
      <Screen
        imageUrl={ursinho_S2_pandinha}
        bgColor={colors.red}
        textColor={colors.white}
        title="Inaet"
        text="Da moze si ogromen inaet i mnogu si nedorazbirliva"
        btnText="<3"
        sequency="5"
      />
      <Screen
        imageUrl={ursinha_chorando}
        bgColor={colors.purple}
        textColor={colors.white}
        title="Koga gresam"
        text="Ama zatoa si prvata da me popravis koga ke zgresam (Osobeno vo valorant)"
        btnText="<3"
        sequency="6"
      />
      <Screen
        imageUrl={ursinho_chorando}
        bgColor={colors.green}
        textColor={colors.white}
        title="Tuka si za mene"
        text="I vo koj bilo koe vreme sekogas si bila tuka za mene i so bilo sto znam deka mozam kaj tebe da dojdam"
        btnText="<3"
        sequency="7"
      />
      <Screen
        imageUrl={pandinha_brava}
        bgColor={colors.yellow}
        textColor={colors.white}
        title="Tuka sum za tebe"
        text="I sekogas vo bilo koe vreme sekogas ke bidam tuka za tebe bezrazlika sto i da e"
        btnText="<3"
        sequency="8"
      />
      <Screen
        imageUrl={ursinho_catucando_pandinha}
        bgColor={colors.purple}
        textColor={colors.white}
        title="Interesno mi e so tebe"
        text="Nema druga licnost na svetov sto moze da mi napravi da mi bide interesno kako ti sto mozes "
        btnText="<3"
        sequency="9"
      />
      <Screen
        imageUrl={ursinho_coracao}
        bgColor={colors.blue}
        textColor={colors.white}
        title="Mila i Bojan"
        text="Se blizi godina, no se custvuva kako da sme zaedno mesec, i kako sme pominale vekovi zaedno."
        btnText="<3"
        sequency="10"
      />
      <Screen
        imageUrl={pandinha_coracao}
        bgColor={colors.yellow}
        textColor={colors.white}
        title="Te sakam"
        text="Najmnogu te sakam Mila, nemozam da opisam so zborovi kolku te sakam"
        btnText="<3"
        sequency="11"
      />
      <Screen
        imageUrl={ursinhos_apaixonados}
        bgColor={colors.red}
        textColor={colors.white}
        title="Valentine ?"
        text="Dali ke bides mojot Valentine ?"
        btnText="YES (nemas drug izbor)"
        sequency="12"
      />
    </div>
  );
};

export default App;
